import React, {Component} from 'react'
import Table from './Table'

class App extends Component {
    render () {
        state = {
            characters: [
                {
                    name: 'Charlie',
                    job: 'Janitor',
                    location: 'New Mexico',
                },
                {
                    name: 'Mac',
                    job: 'Bouncer',
                    location: 'LosAngels',
                },
                {
                    name:'Artee',
                    job: 'Designer',
                    location:'London',

                },
                {
                    name: 'Dennis',
                    job: 'Mustafa',
                    location: 'Moscow',
                },
            ]
        }

        return (
            <div className="container">
                <Table characterData={characters} />
            </div>
        )
    }
}

export default App // Экспортируем компенент и загружаем его в индекс.джс
